data=[QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='Gipatangtang ni Mandaue City treasurer Regal Oliva ang mga poster sa kadalanan sa dakbayan nga nagpakita sa iyang hulagway taliwala sa huhungihong nga modagan siya sa umaabot nga eleksyon sa Mayo sunod tuig.', answer_text='Regal Oliva', answer_start=38, answer_end=50), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='Gihangop ni Oliva ang maong lakang nga padayon pa niyang gikonsiderar apan ang pagdumala sa panalapi sa dakbayan sa Mandaue maoy mas mahinungdanon’g katungdanan alang kaniya sa pagka karon.', answer_text='Mandaue', answer_start=119, answer_end=126), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='Karong bag-o, adunay mga poster sa kadalanan sa siyudad nga nagpakita sa iyang imahe, hinungdan nga mitumaw ang espekulasyon nga siya modagan sa 2025 midterm elections.', answer_text='2025 midterm elections', answer_start=128, answer_end=148), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='Agi’g tubag, gimando ni Oliva nga tangtangon una ang mga poster gumikan kay wa pa siyay final nga desisyon mahitungod niini.', answer_text='wa pa siyay final nga desisyon', answer_start=108, answer_end=135), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='Miasoy si Oliva sa mga tigbalita nga taliwala sa awhag kaniya sa ubang mga partido ug nagkalain-laing sektor nga modagan, ang iyang posisyon karon isip tig kolekta og buhis ug pagdumala sa panudlanan sa syudad mamahimong mas gikinahanglan kaysa sa lehislatibo nga posisyon.', answer_text='tig kolekta og buhis ug pagdumala sa panudlanan sa syudad', answer_start=163, answer_end=199), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='“If I decide to run, it will be a personal decision, not because of others who might have their own motives,” matod ni Oliva.', answer_text='personal decision', answer_start=55, answer_end=73), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='Sa miaging mga taho, si Oliva niingon nga iyang hagiton si incumbent Mandaue City Lone District Rep. Emmarie “Lolypop” Quano-Dizon sa umaabot nga piniliay.', answer_text='Emmarie “Lolypop” Quano-Dizon', answer_start=94, answer_end=131), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='Kini nga espekulasyon nitumaw human gipasanginlan ni Oliva ang kongresista nga maoy nisuway sa pagbalhin kaniya ngadto sa Navotas City.', answer_text='Navotas City', answer_start=147, answer_end=160), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='Gipasabot ni Oliva nga ang mga poster diin anaa ang iyang dagway mahimong binuhatan sa mga tawo nga nag-awhag kaniya sa pagdagan.', answer_text='mga poster diin anaa ang iyang dagway', answer_start=14, answer_end=57), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='“There are so many parties and sectors in the community urging me to run, so that might be why the posters were posted,” si Oliva nagkanayon.', answer_text='daghang partido ug sektor', answer_start=42, answer_end=58), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='Namatikdan niya nga samtang gipasalamatan niya ang suporta gikan sa iyang mga higala, samtang ang gugma ug pagdasig labi ka daghan, gihangyo niya nga tangtangon kini nga mga poster tungod kay wala pa siya makahukom sa pagdagan karong umaabot eleksyon.', answer_text='wala pa siya makahukom', answer_start=141, answer_end=158), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='Matud niya nga sanglit pipila pa ka bulan una pa moabot ang adlaw sa piniliay, mahinungdanon nga adunay pagtahod sa tukma nga panahon alang sa ingon niini nga mga inisyatibo.', answer_text='tukma nga panahon', answer_start=142, answer_end=155), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='“I’m sorry, but I had them taken down because I don’t want to be seen as a traditional politician with my face all over the city,” saysay sa Mandaue City treasurer.', answer_text='traditional politician', answer_start=111, answer_end=129), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='Gihatagan niya og gibug-aton nga adunay tukma nga panahon alang sa mga materyales sa kampanya, ug sayo pa kaayo alang sa ingon nga mga pasundayag.', answer_text='tukma nga panahon alang sa mga materyales sa kampanya', answer_start=25, answer_end=66), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='Nakahukom si Oliva nga i-recycle ang mga materyales gikan sa gitangtang nga mga poster ug tarpaulin.', answer_text='i-recycle ang mga materyales', answer_start=31, answer_end=55), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='Siya mismo ang mipalit niini ug gidonar kini ngadto sa mga underprivileged nga mga miyembro sa komunidad aron magamit sa lainlaing mga panginahanglan, lakip ang pag-ayo sa balay.', answer_text='mga underprivileged nga mga miyembro sa komunidad', answer_start=87, answer_end=122), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='“I am calling on all Mandauehanons to help remove and turnover these posters/tarpaulins to me. It would be wonderful if they are not damaged, as I plan to recycle the tarpaulins into reusable bags for the women’s sector in our community.', answer_text='Mandauehanons', answer_start=39, answer_end=54), QA(title='Oliva way klarong molansar, posters iyang gipatangtang', context='Hatagan niya og reward si bisan kinsa nga mouli sa mga posters ngadto sa iyang buhatan sa City Hall nga P100 alang sa poster nga naay frame ug P25 alang sa poster lang.', answer_text='P100 alang sa poster nga naay frame', answer_start=46, answer_end=75)]